import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Admin from './Admin';
import Recruiters from './admin/recruiters/Recruiters';
import Freelancers from './admin/freelancers/Freelancers';
import Skills from './admin/skills/Skills';
import AddSkill from './admin/skills/AddSkill';

const AdminRouting = () => {
  return (
    <Router>
      <Routes>
        <Route path="/admin" element={<Admin />} />
        <Route path="/admin/recruiters" element={<Recruiters />} />
        <Route path="/admin/freelancers" element={<Freelancers />} />
        <Route path="/admin/skills" element={<Skills />} />
        <Route path="/admin/skills/add" element={<AddSkill />} />
        <Route path="/" element={<Navigate to="/admin" />} />
      </Routes>
    </Router>
  );
};

export default AdminRouting;
